import { Link } from 'react-router-dom'
import styled from 'styled-components'

const Ul = styled.ul`
    .links{
        margin-left: auto;
        margin-right: 50px;
        flex-flow: row rowrap;
    }
`;

const RightNav = () => {
    return ( 
        <Ul>
            <div className = "links">
                <Link to = "/">Home</Link>
                <Link to = "/AboutUs">About Us</Link>
            </div>
        </Ul>
    );
}
 
export default RightNav;
